column8:
空気入れからパンク修理まで便利な道具！自転車ツールキット!!<br>
<br>
お出かけ中のトラブルに便利！<br>
タイヤの空気漏れやパンク、チェーン外れなど自転車のトラブル時に便利！<br>
マジックテープでフレームに固定できるので、自転車に取り付けて持ち運べます。<br>
<br>
万が一のために持っておきたいツールキットです。<br>
<br>
専用ケース付属！自転車に取り付け可能！<br>
ケースにはマジックテープが付いており、自転車の邪魔にならない場所に<br>
簡単に取り付け可能！<br>
<br>
重さが約500gの軽量でサイクリングの邪魔になりません。<br>
<br>
サイズ(約)：縦22cm×横9cm×厚さ5cm ※ケース収納時<br>
重量(約)：500g<br>
セット内容：空気入れ(仏式)、6角レンチ、タイヤレバー、<br>
　　　　　　ドライバーセット、パンク修理セット(パッチ、ヤスリ、ノリ、虫ゴム)<br><br>
製造国：中国<br>
<br>
※日本語説明書は付属しておりません。<br>
